		if (chatInput.value.length + name.length + id.length + 4 > chatInput.maxLength) {

			alert(`Limit exceeded, Max limit is ${chatInput.maxLength}.`);
			return false;

		} else {

			insertAtCaret(chatInput, `<:${name}:${id}>`);
			return true;

		}

